import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import HomeScreen from "../screens/HomeScreen";

import Header from "./Header";

const App = () => {
  return (
    <div className="container-fluid">
      <BrowserRouter>
        <div>
          <Header />
          <HomeScreen />
        </div>
      </BrowserRouter>
    </div>
  );
};

export default App;
